import React from 'react'

function ImagenEncontrada(img_route) {
  console.log('recibiendo imágen: '+ img_route)
  return (
    <div className='imgencontrada'>Resultado
      <div className='muestraimagen'>
        {
          img_route &&
          <img src= {img_route} alt="Vestido " style={{ width: '200px', height: '300px' }} className='img' />  
        }
      </div>
    </div>
    
  )
}

export default ImagenEncontrada;
